import React from "react";
import Card from "./Card";

const CardList = function({ robots }) {
    const CL = [];
    for (let robot in robots) 
        CL.push(<Card id={robot.id} name={robot.name} email={robot.email}/>)
    return (
        CL
    );
};

export default CardList;
